def gcd(a, b): # return greatest common divisor
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def lcm(a, b): # return least common multiple
    return a * b // gcd(a, b)

n = int(input())
a = list(map(int, input().split()))

ans = a[0]
for i in range(1, n):
    ans = lcm(ans, a[i])

print(ans)

